	AC_SAN_CLICK = 4 [(gogoproto.enumvalue_customname) = "AcSanClick"];
	AC_IMPRESSION = 5 [(gogoproto.enumvalue_customname) = "AcImpression"];
	AC_SAN_IMPRESSION = 6 [(gogoproto.enumvalue_customname) = "AcSanImpression"];
	AC_INSTALL = 7 [(gogoproto.enumvalue_customname) = "AcInstall"];
	AC_REJECTED_INSTALL = 8 [(gogoproto.enumvalue_customname) = "AcRejectedInstall"];
	AC_SESSION = 9 [(gogoproto.enumvalue_customname) = "AcSession"];
	AC_EVENT = 10 [(gogoproto.enumvalue_customname) = "AcEvent"];
	AC_REATTRIBUTION = 11 [(gogoproto.enumvalue_customname) = "AcReattribution"];
