	AC_OPT_OUT = 17 [(gogoproto.enumvalue_customname) = "AcOptOut"];
	AC_GDPR_FORGET_DEVICE = 18 [(gogoproto.enumvalue_customname) = "AcGdprForgetDevice"];
	AC_AD_REVENUE = 19 [(gogoproto.enumvalue_customname) = "AcAdRevenue"];
	AC_COST_UPDATE = 20 [(gogoproto.enumvalue_customname) = "AcCostUpdate"];
